 Here's a sample Python program to determine the cognitive behavioral constructs of Alexander Martin and Samantha Torres based on their statements:

```python
def determine_constructs(statement):
    # Define the cognitive-behavioral constructs
    construct_dict = {'Belief': ['Goal', 'Affect', 'Vulnerability'],
'Norms': ['Moral', 'Social', 'Affect', 'Vulnerability'],
'Intent': ['Response Efficacy', 'Group norms', 'Costs', 'Affect'],
'Moral': ['Belief', 'Goal', 'Affect', 'Vulnerability']}

    # Get the cognitive-behavioral constructs for Alexander Martin and Samantha Torres
    construct_Martin = []
    construct_Torres = []
    for sentence in statement.split('.'):
        word_list = sentence.strip().lower().split()
        if 'believe' in word_list:
            construct_Martin.append('Goal')
        elif 'intentional' in word_list and 'misuse' in word_list:
            construct_Martin.append('Affect')
        elif 'repercussions' in word_list:
            construct_Martin.append('Vulnerability')
        else:
            for construct in construct_dict['Belief']:
                if construct in word_list:
                    construct_Martin.append(construct)
            for construct in construct_dict['Moral']:
                if construct in word_list:
                    construct_Martin.append(construct)

    for sentence in statement.split('.'):
        word_list = sentence.strip().lower().split()
        if 'understand' in word_list and 'repercussions' in word_list:
            construct_Torres.append('Affect')
        elif 'praised' in word_list:
            construct_Torres.append('Moral')
        else:
            for construct in construct_dict['Norms']:
                if construct in word_list:
                    construct_Torres.append(construct)
            for construct in construct_dict['Affect']:
                if construct in word_list:
                    construct_Torres.append(construct)

    return construct_Martin, construct_Torres
```
